const BBOX_PAD = 0.1;
let N_LANDMARKS = 60;
const EYEBROW_START = 17;
const EYEBROW_END = 26;

/**
 * Delete the facial landmarks in the range 60-67
 * and shift everything down, since the teeth cause
 * a lot of problems when doing the expression transfer
 * @param {array} points List of 2D points for facial landmarks
 * @returns An array of the cut down points
 */
function cutOutInnerMouth(points) {
    let ret = [];
    for (let i = 0; i < 60; i++) {
        ret.push(points[i]);
    }
    for (let i = 68; i < points.length; i++) {
        ret.push(points[i]);
    }
    return ret;
}

/**
 * Compute a set of points that will be added to the end of a facial landmark
 * point cloud.  The new points consist of a padded bounding box around the
 * landmarks, as well as a box around the entire image
 * 
 * @param {array} points List of 2D points for facial landmarks
 * @returns An array of the new points
 */
 function getBBoxPaddedPoints(points) {
    let maxX = points[0][0];
    let minX = points[0][0];
    let minY = points[0][1];
    let maxY = points[0][1];
    for (i = 0; i < points.length; i++) {
        if (points[i][0] > maxX) {
            maxX = points[i][0];
        } 
        else if (points[i][0] < minX) {
            minX = points[i][0];
        }
        if (points[i][1] > maxY) {
            maxY = points[i][1];
        } 
        else if (points[i][1] < minY) {
            minY = points[i][1];
        }
    }
    let width = maxX - minX;
    let height = maxY - minY;
    maxX = maxX + width*BBOX_PAD;
    minX = minX - width*BBOX_PAD;
    maxY = maxY + height*BBOX_PAD;
    minY = minY - height*BBOX_PAD;
    return [[minX,minY],[maxX,minY],[maxX,maxY],[minX,maxY]];
}


